import React from 'react';
import { Grid } from '@material-ui/core';
import ReadingDetailsCardItem from 'app/views/components/CreateReadingTest/ReadingDetailsCardItem';
import styled from 'styled-components';

const Wrapper = styled(Grid)`
	margin-top: 30px !important;
`;

const initialData = [
	{ title: 'Reading Test', location: 'reading' },
	{ title: 'Listening Test', location: 'listening' },
	{ title: 'Writing Test', location: 'writing' },
	{ title: 'Speaking Test', location: 'speaking' },
];

function TestDetailsCardRender(props) {
	const { handleChangeLocation, currentTestData } = props;
	const testDetails = currentTestData.testDetails;
	const { readingTest } = testDetails;
	return (
		<Wrapper container spacing={3}>
			{initialData.map((test, idx) => {
				return (
					<Grid item xs={12} md={6} key={idx}>
						<ReadingDetailsCardItem
							handleChangeLocation={() => handleChangeLocation(test.location)}
							title={test.title}
							readingTest={readingTest}
						></ReadingDetailsCardItem>
					</Grid>
				);
			})}
		</Wrapper>
	);
}

export default TestDetailsCardRender;
